import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'
import App from './App'; // Your main application component
import { BrowserRouter } from 'react-router-dom';

// ReactDOM.render(
//   <React.StrictMode>
//     <App />
//   </React.StrictMode>,
//   document.getElementById('root')
// );

function WrappedApp() {
  return (
    <BrowserRouter>
      <App />
    </BrowserRouter>
  );
}

ReactDOM.render(
  <WrappedApp />,
  document.getElementById('root')
);
